import { useEffect, useState } from "react";
import GetEurUsd from "./getEURUSD";

const EURUSDrate = () => {
  const [eurusd, setEurusd] = useState(0);

  useEffect(()=>{
    GetEurUsd().then((response) => setEurusd(response))
  },[])
  console.log(eurusd)
  return <div>EUR/USD</div>;
};

export default EURUSDrate;
